import styled from "styled-components";

export const Transaction = styled.div`
  .contain {
    display: flex;
    flex-direction: column;
    justify-content: center;
    // align-items: center;
  }

  .contain .list {
    list-style: none;
    display: block;
  }

  .contain .list li {
    display: block;
    cursor: pointer;
    font-size: 0.9em;
  }
`;
